    /** Will return the index where the date can be inserted and if the date exists */
    function findCouponIndex(
        uint256 _couponDate
    ) internal view returns (uint256 index, bool found) {
        // Works on the assumption that the list of coupons dates are sorted
        for (uint256 i = 0; i < _data.couponDates.length; i++) {
            // Raises a slither warning on https://github.com/crytic/slither/wiki/Detector-Documentation#dangerous-strict-equalities
            // But this is an accepted situation as we need to compare the provided date with the array
            if (_data.couponDates[i] == _couponDate) {
                return (i, true);
            } else if (_data.couponDates[i] > _couponDate) {
                // we wont find a coupon now that
                return (i, false);
            }
        }
        return (_data.couponDates.length, false);
    }

    function checkIfCouponDateExists(
        uint256 _couponDate
    ) public view returns (bool) {
        (, bool found) = findCouponIndex(_couponDate);
        if (found) return true;
        if (_data.maturityDate == _couponDate) return true;
        return false;
    }

    function checkIfMaturityDateExists(
        uint256 _maturityDate
    ) external view returns (bool) {
        return _data.maturityDate == _maturityDate;
    }

    /*
     * Find the next couponDate, that is the one which is just after the current one;
     * returns 0 if not found or nextDate does not exist.
     */
    function _nextCouponDate(uint256 current) private view returns (uint256) {
        //TODO: use the findCouponIndex instead
        for (uint256 index = 0; index < _data.couponDates.length; index++) {
            if (_data.couponDates[index] == current) {
                //if next exist then return it
                if (index + 1 < _data.couponDates.length) {
                    return _data.couponDates[index + 1];
                } else {
                    return _data.maturityDate;
                }
            }
        }

        return 0;
    }

    function _beforeTokenTransfer(
        address from_,
        address to_,
        uint256 amount_
    ) internal virtual override {
        require(status != Status.Repaid, "the Register is closed");

        require(
            balanceOf(from_) >= amountLocked[from_] + amount_,
            "Insufficient balance"
        );

        super._beforeTokenTransfer(from_, to_, amount_);
    }

    function lockAsset(LockInfo memory _lockInfo) public {
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                hasRole(BND_ROLE, msg.sender) ||
                investorsAllowed(msg.sender) ||
                isContractAllowed(msg.sender),
            "Caller not authorized"
        );

        LockStatus _lockStatus = sellerLocks[_lockInfo.transactionID].status;

        // check the HTLC status
        require(_lockStatus == LockStatus.Unlocked, "Lock already set");

        // check the _lockInfo status
        require(_lockInfo.status == LockStatus.Unlocked, "Invalid status");

        // check the addresses
        require(
            _lockInfo.seller != address(0) && _lockInfo.buyer != address(0),
            "Invalid address"
        );

        require(
            _lockInfo.paymentDate <= _lockInfo.deliveryDate,
            "Invalid dates"
        );

        // //make sure the recipient is an allowed investor
        // require(
        //     investorsAllowed(_lockInfo.buyer) == true,
        //     "The receiver is not allowed"
        // );

        // require(
        //     investorsAllowed(_lockInfo.seller) == true || // the seller must be a valid investor at the time of transfer
        //         hasRole(BND_ROLE, _lockInfo.seller), // or the seller is the B&D for the primary distribution
        //     "The sender is not allowed"
        // );

        // check the amount to lock
        require(_lockInfo.amount > 0, "Invalid amount");

        // check that the _lockInfo.seller has the amount
        require(
            balanceOf(_lockInfo.seller) >=
                _lockInfo.amount + amountLocked[_lockInfo.seller],
            "Insufficient balance"
        );

        // check the dates
        require(
            _lockInfo.paymentDate > block.timestamp &&
                _lockInfo.deliveryDate >= _lockInfo.paymentDate,
            "Invalid dates"
        );

        amountLocked[_lockInfo.seller] += _lockInfo.amount;

        // set the lock information
        sellerLocks[_lockInfo.transactionID] = _lockInfo;

        // emit the event
        emit AssetLocked(
            _lockInfo.transactionID,
            _lockInfo.paymentID,
            _lockInfo.status
        );
    }

    function release(
        bytes32 _transactionID,
        bytes32 _secret,
        bytes32 _paymentProof
    ) public {
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                hasRole(BND_ROLE, msg.sender) ||
                investorsAllowed(msg.sender) ||
                isContractAllowed(msg.sender),
            "Caller not authorized"
        );

        // get the lock information
        LockInfo memory _lock = sellerLocks[_transactionID];

        // check the HTLC status
        require(
            _lock.status == LockStatus.Locked,
            "Asset not locked or already released"
        );

        // check the HTLC secret
        require(
            sha256(abi.encodePacked(_secret)) == _lock.hashlock,
            "Invalid secret"
        );

        // update status
        _lock.status = LockStatus.Released;

        amountLocked[_lock.seller] -= _lock.amount;

        // save artifacts
        sellerLocks[_transactionID].artifact.paymentProof = _paymentProof;
        sellerLocks[_transactionID].artifact.secret = _secret;

        // transfer the asset to the buyer
        transferFrom(_lock.seller, _lock.buyer, _lock.amount);

        // emit the event
        emit AssetReleased(
            _transactionID,
            _lock.paymentID,
            LockStatus.Released
        );
    }

    function forceRelease(
        bytes32 _transactionID,
        bytes32 _secretRelease,
        bytes32 _paymentProof
    ) public {
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                hasRole(BND_ROLE, msg.sender) ||
                investorsAllowed(msg.sender) ||
                isContractAllowed(msg.sender),
            "Caller not authorized"
        );

        // get the lock information
        LockInfo memory _lock = sellerLocks[_transactionID];

        // check the HTLC status
        require(
            _lock.status == LockStatus.Locked,
            "Asset not locked or already released"
        );

        // check the HTLC secret
        require(
            sha256(abi.encodePacked(_secretRelease)) == _lock.hashRelease,
            "Invalid force release secret"
        );

        // check the payment date
        require(
            block.timestamp > _lock.deliveryDate,
            "Cannot force release before payment date"
        );

        // update status
        _lock.status = LockStatus.ForceReleased;

        amountLocked[_lock.seller] -= _lock.amount;

        // save artifacts
        sellerLocks[_transactionID].artifact.paymentProof = _paymentProof;
        sellerLocks[_transactionID].artifact.secretCancel = _secretRelease;

        // transfer the asset to the buyer
        transferFrom(_lock.seller, _lock.buyer, _lock.amount);

        // emit the event
        emit AssetReleased(
            _transactionID,
            _lock.paymentID,
            LockStatus.ForceReleased
        );
    }

    function forceCancel(
        bytes32 _transactionID,
        bytes32 _secretCancel,
        bytes32 _paymentProof
    ) public {
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                hasRole(BND_ROLE, msg.sender) ||
                investorsAllowed(msg.sender) ||
                isContractAllowed(msg.sender),
            "Caller not authorized"
        );

        // get the lock information
        LockInfo memory _lock = sellerLocks[_transactionID];

        // check the HTLC status
        require(
            _lock.status == LockStatus.Locked,
            "Asset not locked or already released"
        );

        // TODO check with Guenole that CAK can enforce release at anytime

        // check the payment date
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                block.timestamp > _lock.paymentDate,
            "Cannot force cancel before delivery date"
        );

        // check the HTLC secret
        /// @dev in Normal HTLC, the secretCancel is the hash of the normal secret
        require(
            hasRole(CAK_ROLE, msg.sender) ||
                sha256(abi.encodePacked(_secretCancel)) == _lock.hashCancel,
            "Invalid force release secret"
        );

        // update status
        _lock.status = LockStatus.ForceCancelled;

        amountLocked[_lock.seller] -= _lock.amount;

        // save artifacts
        sellerLocks[_transactionID].artifact.paymentProof = _paymentProof;
        sellerLocks[_transactionID].artifact.secretCancel = _secretCancel;

        // emit the event
        emit LockCancelled(
            _transactionID,
            _lock.paymentID,
            LockStatus.ForceCancelled
        );
    }
}

